import React from "react";
import styles from "./Table.module.css";

const RowTable = (props) => {
  const arrivalTimestamp = props.arrival;
  const arrDate = new Date(arrivalTimestamp);
  const arrival =
    arrDate.getHours.toString() + ":" + arrDate.getMinutes.toString();
  const departureTimestamp = props.departure;
  const depDate = new Date(departureTimestamp);
  const departure =
    depDate.getHours.toString() + ":" + depDate.getMinutes.toString();

  return (
    <div className={styles.row}>
      <div className={styles.column_text}>
        <span>{departure}h</span>
        <span>{props.from}</span>
      </div>
      <div className={styles.column_text}>
        <span>Duration</span>
        <span>{props.duration}h</span>
      </div>
      <div className={styles.column_text}>
        <span>{arrival}h</span>
        <span>{props.to}</span>
      </div>
      <div className={styles.column_text}>
        <span>Operator</span>
        <span>FlixBus</span>
      </div>
      <div className={styles.column_text}>
        <span>Price</span>
        <span>{props.price} â‚¬</span>
      </div>
      <div className="add_button">
        <button type="button">Add</button>
      </div>
    </div>
  );
};

export default RowTable;
